const Navbar = ({viewStatus, makeLarger, handleResize}) => {
    return (
        <div className="full-width navbar">
            <button className="resize-button minus" onClick={makeSmaller}>-</button>
            <p className="navtext">{viewStatus ? 'ToDo View': 'Group View'}</p>
            <button className="resize-button plus" onClick={makeLarger}>+</button>
        </div>
    );
}

export default Navbar;
